angular.module('app.home',[])

/**
* app Module
*
* Description
*/
angular
  .module('pandaApp', ['ui.router'])
  .config(appConfig);

  appConfig.$inject = ['$stateProvider','$urlRouterProvider', '$locationProvider'];

  function appConfig($stateProvider,$urlRouterProvider,$locationProvider){
      $stateProvider
        .state('home',{
          url : "/",
          templateUrl:'panda-home.html',
          controller: 'HomeController',
          controllerAs :'HomeCtrl'
        })
        .state('about',{
          url :"/about",
          templateUrl:'panda-about.html',
          controller: 'AboutController',
          controllerAs : 'AboutCtrl'
        })
        .state('careers',{
          url : "/careers/:id",
          templateUrl : 'panda-career.html',
          controller : 'CareerController',
          controllerAs : 'CareerCtrl'
        })
        .state('signup',{
          url : "/signup",
          templateUrl : 'panda-signup.html'
        })

      // $locationProvider.html5Mode({
      //   enabled: true,
      //   requireBase: false
      // });

      $urlRouterProvider.otherwise('/');
};

/**
* pandaApp Module
*
* Description
*/
angular
  .module('pandaApp')
  .controller('AboutController',AboutController)

  function AboutController(){
    var vm = this; 
    var top = $("#career").offset().top  - 3.5*parseFloat($('#career').css('marginTop').replace(/auto/,0));
    $('#joinus').click(function () {
        $('html,body').animate({scrollTop:top}, 500);
    });
  };

/**
* panadaApp Module
*
* Description
*/
angular
  .module('pandaApp')
  .controller('CareerController',CareerController);

  CareerController.$inject = ['$stateParams','$q'];

  function CareerController($stateParams){
    var vm = this; 
    vm.careerId = $stateParams.id;


  };



/**
* app.home Module
*
* Description
*/
angular
  .module('pandaApp')
  .controller('HomeController',HomeController)

  function HomeController(){

    var vm = this; 

    vm.timer = "test";

    $(".headline").hide().animate({ left:"0px", opacity:"show"}, 1500);
   
    $(window).scroll(function() {
      $('.hideme').each(function(i){
        var bottom_of_object = $(this).offset().top + $(this).outerHeight();
        var bottom_of_window = $(window).scrollTop() + $(window).height();
         if( bottom_of_window > bottom_of_object ){
            console.log("done")
              $('.hideme').animate({left:200, opacity:"show"}, 1500);              
            }
      })
    });

  };

